    function setMapOnAll(map) {
        for (var i = 0; i < markers.length; i++) {
          markers[i].setMap(map);
        }
      }

    // Removes the markers from the map, but keeps them in the array.
    function clearMarkers() {
        setMapOnAll(null);
    }

    // Shows any markers currently in the array.
    function showMarkers() {
        setMapOnAll(map);
    }

    // Deletes all markers in the array by removing references to them.
    function deleteMarkers() {
        clearMarkers();
        markers = [];
    
    }    

    //calculate route, learning from https://developers-dot-devsite-v2-prod.appspot.com/maps/documentation/javascript/examples/directions-simple
    function calculateAndDisplayRoute(directionsService, directionsRenderer,destination,starting) {
       // alert('test navigation');
        var destination = destination;
        var start = starting;
        
        directionsService.route(
            {
                
              origin: {query: start},
              destination: {query: destination},
              travelMode: 'DRIVING'
            },
            function(response, status) {
              if (status === 'OK') {
                directionsRenderer.setDirections(response);

              } else {
                  if (status == "NOT_FOUND") {
                    window.alert('Cannot find this location.');
                  } else if (status == "ZERO_RESULTS") {
                    window.alert('Cannot find a direction from this location to the club.');
                  } else {
                    window.alert('Directions request failed due to ' + status);
                  }
                
              }
            });
      }
    
    function call_route(address){
        var input=address;
        var start=$('#start').val();
        //alert('starting from'+start+','+'end'+input);
        calculateAndDisplayRoute(directionsService, directionsRenderer,input,start);
    }

    
    //learned from https://developers-dot-devsite-v2-prod.appspot.com/maps/documentation/javascript/examples/geocoding-simple
    //learned from https://www.youtube.com/watch?v=pRiQeo17u6c

    function geocodeAddress(geocoder, resultsMap,title_input,streets_input,suburbs_input,postcode_input,state_input,phone_input,email_input,website_input) {
       
       //var address = document.getElementById('address').value;
       var title=title_input;
       var streets=streets_input;
       var suburbs=suburbs_input;
       var postcode=postcode_input;
       var state=state_input;
       var phone=phone_input;
       var email=email_input;
       var website=website_input;

       var address =  title +', '+streets+', '+suburbs+', '+state+', '+postcode;
       //alert(address);
       geocoder.geocode({'address': address}, function(results, status) {
         if (status === 'OK') {
           resultsMap.setCenter(results[0].geometry.location);
           var marker = new google.maps.Marker({
             map: resultsMap,
             position: results[0].geometry.location,
             
           });
           
           //push mark to the markers array
           markers.push(marker);
           var contentString = '<h4>'+address+'</h4>';
           map.setZoom(11);
