    //all the data functions
    function iterateRecords(data,sports) {
        deleteMarkers();
        
        geocoder = new google.maps.Geocoder();

        console.log(data);
        var sportSelect= sports;

        //initMap();
        // record count
        var count = 0;

        //empty the previous content 
        $("#records").empty();

        //for each content
        $.each(data.result.records, function(recordKey, recordValue) {
            
            //find all the records content
            var recordTitle = recordValue["Organisation"];
            var recordStreet = recordValue["Street Address"];
            var recordSuburb = recordValue["Street Address Suburb"];
            var recordPostcode = recordValue["Street Address Postcode"];
            var recordPhoneNumber = recordValue["Phone"];
            var recordState = recordValue["Street Address State"];
            var recordSport = recordValue["Sport"];
            var recordEmail = recordValue["Email"];
            var recordWebsite = recordValue["Website"];
            var recordAddress = recordTitle +', '+recordStreet+', '+recordSuburb+', '+recordState+', '+recordPostcode;
           
            
            //if content is valid
            if(recordTitle!="" && recordStreet!="" && recordSuburb!="" && recordPostcode!="" && recordPhoneNumber!=""  && recordEmail!=""  && recordWebsite!="" ) {
                
                //if the state is qld and sports is same as the selected
                if(recordState == "QLD" && recordSport.includes(sportSelect)) { // 
                    count++;
                    //setTimeout(geocodeAddress(geocoder, map, recordAddress),5000);
                    setTimeout(geocodeAddress(geocoder, map, recordTitle,recordStreet,recordSuburb,recordPostcode,recordState,recordPhoneNumber,recordEmail,recordWebsite),5000);


                    var button = $('<input/>').attr({
                         type: "button",
                         id: "schedule",
                         class: "class=btn btn-primary",
                         value: "Add the sports to Schedule"
                    });
                    //$("#records").append(button);
                    //alert(recordAddress);
                    $("#records").append( 
                        $('<div class="singleClub record mb-5">').append(
                            $('<div class="clubTitle my-1">').append($('<h4>').text(recordTitle), $('<hr>')),
                            $('<h6 class="street">').text(recordStreet),
                            $('<h6 class="suburb">').text(recordSuburb),
                            $('<h6 class="postcode">').text(recordPostcode),
                            $('<h6 class="phoneNumber">').text(recordPhoneNumber),
                            $('<h6 class="sport">').text(recordSport),
                            $('<h6 class="address">').text(recordAddress)
                            //button
                                               
                        )
                    );

                }

            }

            //get the record length 
            $("#filter-count strong").text(count);
        
            //when suburb change 
            $("#suburb").change(function(event) {
                
                var searchTerm = $(this).val();
                
                console.log(searchTerm);

                $(".record").hide();
                $(".suburb:contains('" + searchTerm + "')").parent().show();
                
                $("#filter-count strong").text($(".record:visible").length);
            });


        });
        
    };
            
    //function that load the data set api
    function loadApi() {
        var slqData = JSON.parse(localStorage.getItem("slqData"));

        // if (slqData) {
        // 	console.log("Source: localStorage");
        // 	iterateRecords(slqData);
        // } else {
        console.log("Source: ajax call");
        var data = {
            resource_id: 'f07cb35c-ac11-448c-af6b-e61f8529a577', // the resource id
            limit: 80, // get 100 results
        };

        $.ajax({
            url: "https://data.qld.gov.au/api/3/action/datastore_search",
            data: data,
            dataType: "jsonp", // We use "jsonp" to ensure AJAX works correctly locally (otherwise XSS).
            cache: true,
            success: function(data) {
               // alert('Total results found: ' + data.result.total);
                localStorage.setItem("slqData", JSON.stringify(data));
                iterateRecords(data);
            }
        });

        // }
    };

    function selectApi(sports) {
        var slqData = JSON.parse(localStorage.getItem("slqData"));
        var sportsinput=sports;
        // if (slqData) {
        // 	console.log("Source: localStorage");
        // 	iterateRecords(slqData);
        // } else {
            console.log("Source: ajax call");
            var data = {
                resource_id: 'f4300e85-f5e5-485d-81e3-c47e088d0fa3', // the resource id
                limit: 2200, // get 100 results
            };

            $.ajax({
                url: "https://data.qld.gov.au/api/3/action/datastore_search",
                data: data,
                dataType: "jsonp", // We use "jsonp" to ensure AJAX works correctly locally (otherwise XSS).
                cache: true,
                success: function(data) {
                    //alert('Total results found: ' + data.result.total);
                    //localStorage.setItem("slqData", JSON.stringify(data));
                
                    iterateRecords(data,sportsinput);
                    
                }
            });

    };

